angular.module('masteries.templates', []).run(['$templateCache', function($templateCache) {
    $templateCache.put('masteries/components/app/template.html', '<div class="su-masteries-app su-pane"><div class="su-pane-header"><span class="su-pane-title">Masteries</span><ul class="su-actions"><li ng-click="ctrl.reset()" class="su-action danger"><i class="reset">Reset</i></li></ul></div><div class="su-pane-body empty"><su-masteries-tree ng-repeat="tree in ctrl.masteries.trees track by $index" tree="tree"></su-masteries-tree></div></div>');

    $templateCache.put('masteries/components/talent/template.html', '<div ng-style="talent | style:tree" class="su-masteries-talent-container"><div ng-click="ctrl.spend($event, talent)" su-rclick="ctrl.refund($event, talent)" class="su-masteries-talent {{ talent | classname:tree }}"><div ng-style="talent | sprite" class="bg"></div><span class="points">{{ talent.points }} / {{ talent.ranks }}</span></div><su-masteries-tooltip talent="talent"></su-masteries-tooltip></div>');

    $templateCache.put('masteries/components/tooltip/template.html', '<div ng-class="{ \'x-small\': talent.description[talent.points].length &lt; 30 }" class="su-masteries-tooltip"><span class="name">{{talent.name}}</span><span class="rank">Rank: {{talent.points}} / {{talent.ranks}}</span><span ng-bind-html="talent.description[talent.points - 1] | sanitize" ng-show="talent.points &gt; 0" class="desc"></span><hr ng-show="talent.points &gt; 0 &amp;&amp; talent.points &lt; talent.ranks"><h4 ng-show="talent.points &gt; 0 &amp;&amp; talent.points &lt; talent.ranks">Next Rank:</h4><span ng-bind-html="talent.description[talent.points] | sanitize" ng-show="talent.points &lt; talent.ranks" class="desc"></span></div>');

    $templateCache.put('masteries/components/tree/template.html', '<div class="su-masteries-tree {{ tree.name | lowercase }}"><div class="talent-container"><su-masteries-talent ng-repeat="talent in tree.talents track by $index" talent="talent" tree="tree"></su-masteries-talent></div><div class="meta"><span class="name">{{ tree.name }}</span><span class="points">{{ tree.points }}</span></div></div>');
}])